[{"location":"","page":"Home","title":"Home","text":"CurrentModule = KEGGAPI","category":"page"},{"location":"#KEGGAPI","page":"Home","title":"KEGGAPI","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for KEGGAPI.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"#Functions","page":"Home","title":"Functions","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Modules = [KEGGAPI]","category":"page"},{"location":"#KEGGAPI.conv-Tuple{String, String}","page":"Home","title":"KEGGAPI.conv","text":"KEGGAPI.conv(<targetdb>, <sourcedb>)\n\nConvert KEGG identifiers to/from outside identifiers.\n\nExamples\n\nKEGGAPI.conv(\"eco\", \"ncbi-geneid\")\nKEGGAPI.conv(\"ncbi-geneid\", \"eco\")\nKEGGAPI.conv(\"hsa:10458+ece:Z5100\", \"ncbi-proteinid\")\nKEGGAPI.conv(\"ncbi-geneid:948364\", \"genes\")\n\n\n\n\n\n","category":"method"},{"location":"#KEGGAPI.find","page":"Home","title":"KEGGAPI.find","text":"KEGGAPI.find(database, query) -> KeggTupleList\n\nFind entries in a specific database from the KEGG API.\n\nExamples\n\nKEGGAPI.find(\"compound\",\"glucose\")\n\n\n\n\n\n","category":"function"},{"location":"#KEGGAPI.get_image-Tuple{String}","page":"Home","title":"KEGGAPI.get_image","text":"KEGGAPI.get_image(pathway) -> Image\n\nGet an image of a specific pathway from the KEGG API.\n\nExamples\n\nKEGGAPI.get_image(\"hsa00010\")\n\n\n\n\n\n","category":"method"},{"location":"#KEGGAPI.info-Tuple{String}","page":"Home","title":"KEGGAPI.info","text":"KEGGAPI.info(database) -> String\n\nGet information about a specific database from the KEGG API.\n\nExamples\n\nKEGGAPI.info(\"kegg\")\n\n\n\n\n\n","category":"method"},{"location":"#KEGGAPI.kegg_get","page":"Home","title":"KEGGAPI.kegg_get","text":"KEGGAPI.get(query, option) -> Vector\n\nGet entries from across the KEGG database. The get function takes a vector of strings and returns a vector containing the urls used and the data returned.\n\nThe get function will split the vector into groups of 10 and make a request for each chunk.\n\nExamples\n\nkegg_get_genes = \n    KEGGAPI.kegg_get(\n        [\"hsa:10458\", \"hsa:10458\", \"hsa:10458\", \"hsa:10458\"], \n        \"ntseq\"\n        )\nkegg_get_compounds = \nKEGGAPI.kegg_get(\n    [\"C01290\",\"G00092\"]\n    )\n\n\n\n\n\n","category":"function"},{"location":"#KEGGAPI.link-Tuple{String, String}","page":"Home","title":"KEGGAPI.link","text":"KEGGAPI.conv(<targetdb>, <sourcedb>)\n\nFind related entries by using database cross-references\n\nExamples\n\nKEGGAPI.link(\"pathway\", \"hsa\")\n\n\n\n\n\n","category":"method"},{"location":"#KEGGAPI.list","page":"Home","title":"KEGGAPI.list","text":"KEGGAPI.list(database)\n\nGet a list of entries from a specific database from the KEGG API.\n\nExamples\n\nKEGGAPI.list(\"pathway\")\n\n\n\n\n\n","category":"function"},{"location":"#KEGGAPI.request-Tuple{String}","page":"Home","title":"KEGGAPI.request","text":"request(url)\n\nMake a request to the specified URL and return the response body as a string. If an error occurs, a RequestError is thrown. This function is not intended for direct use. Instead, use the info, list, and find, etc. functions.\n\nExamples\n\nrequest(\"https://rest.kegg.jp/info/kegg\")\n\n\n\n\n\n","category":"method"},{"location":"#KEGGAPI.request_other-Tuple{String}","page":"Home","title":"KEGGAPI.request_other","text":"request_other(url)\n\nMake a request to the specified URL and return the response body as a vector. If an error occurs, a RequestError is thrown. This function is not intended for direct use.\n\nExamples\n\nrequest_other(\"https://rest.kegg.jp/image/hsa00010\")\n\n\n\n\n\n","category":"method"},{"location":"#KEGGAPI.save_image-Tuple{Vector, String}","page":"Home","title":"KEGGAPI.save_image","text":"KEGGAPI.save_image(image, filename) -> filename\n\nSave an image to a file.\n\nExamples\n\nimage = KEGGAPI.get_image(\"hsa00010\")\nKEGGAPI.save_image(image, \"glycolysis.png\")\n\n\n\n\n\n","category":"method"}]
